(82, 'imnotice', '২০১৮ শিক্ষাবর্ষে ভর্তির আবেদন অনলাইনে জমা দিতে হবে।', 'আগামী ১ জানুয়ারি ২০১৮ ইং তারিখ থেকে ১১ জানুয়ারি ২০১৮ সোনার বাংলা উচ্চ বিদ্যালয় এর সকল ভর্তি কার্যক্রম অনলাইনে পরিচালিত হবে। বিদ্যালয়ে ভর্তিইচ্ছু সকল শিক্ষার্থীদের অনলাইনের মাধ্যমে ভর্তির আবেদন করার নির্দেশ দেয়া যাচ্ছে। \r\n\r\nপ্রধান শিক্ষক,\r\nআনন্দ নগর আদর্শ উচ্চ বিদ্যালয়,\r\nবাড্ডা, ঢাকা।', 1, ''),
(87, 'imnotice', '৩য় থেকে ১০ম শ্রেনীর ১ম সাময়িক পরীক্ষা আগামি ০৬/০৪/২০১৭ ইং তারিখ থেকে শুরু হবে', '২০১৭ শিক্ষাবর্ষের ৩য় থেকে ১০ম শ্রেনীর ১ম সাময়িক পরীক্ষা আগামি ০৬/০৪/২০১৭ ইং তারিখ থেকে আরম্ভ হবে। সকল শিক্ষার্থীদের পরীক্ষা শুরু হওয়ার পূর্বেই বেতন এবং পরীক্ষার ফিস প্রদান করে এডমিট কার্ড সংগ্রহ করার জন্য নির্দেশ দেয়া হল।\r\n\r\nপ্রধান শিক্ষক,\r\nআনন্দ নগর আদর্শ উচ্চ বিদ্যালয়,\r\nবাড্ডা, ঢাকা।', 0, ''),
