(129, 'notice', '২০১৮ শিক্ষাবর্ষে ভর্তির আবেদন অনলাইনে জমা দিতে হবে।', '২০১৮ শিক্ষাবর্ষে ৬ষ্ঠ থেকে নবম শ্রেণীর ভর্তির কার্যক্রম ১ জানুয়ারি ২০১৮ থেকে ১১ জানুয়ারি ২০১৮ পর্যন্ত চলবে । ভর্তির আবেদন অনলাইনে জমা দিতে হবে । বিদ্যালয়ে, অফিস চলাকালিন সময়ে আবেদন পত্র পূরণ করা যাবে ।</br>\r\nভর্তি ফি প্রদানের নিয়মাবলী : </br>\r\n১. অনলাইন থেকে প্রাপ্ত ফরম ও প্রবেশ পত্র বিদ্যালয়ের কম্পিউটার সেকশনে জমা দিয়ে ১০০ টাকা ভর্তি পরীক্ষার ফি পরিশোধ করে প্রবেশ পত্র গ্রহন করতে হবে । </br>\r\n২. ভর্তি ফরম, প্রশংসাপত্র / পূর্ববর্তী বিদ্যালয়ের ছাড় পত্র , জন্ম নিবন্ধনের কপি , ১ কপি ছবি সহ  শ্রেণি শিক্ষকের নিকট জমা দিয়ে নির্ধারিত ভর্তি ফি পরিশোধ করে ১ জানুয়ারি / ১৮  থেকে  ১১ জানুয়ারি / ১৮ এর মধ্যে ভর্তি হতে হবে । \r\n</br>\r\n৩. ৬ষ্ঠ ও নবম শ্রেণিতে ভর্তি পরীক্ষার ফলাফলের ভিত্তিতে রোল নাম্বার ও শাখা নির্ধারণ করা হবে । </br>\r\n</br>\r\nআদেশ ক্রমে</br>\r\nপ্রধান শিক্ষক</br>\r\nএ, কে , এম রেজাউল হক\r\n', 1, '');
